m=a1.jp("8. Prohibited Use","The Client and authorized users must not:\n\n\u2022 Use the App for illegal or unauthorized purposes\n\u2022 Attempt to bypass, hack, or exploit the App\u2019s security systems\n\u2022 Conduct penetration testing without the Company\u2019s written approval\n\u2022 Share internal business data externally without authorization\n\u2022 Upload malicious files or engage in harmful activities\n\u2022 Use the App beyond the operational scope agreed with the Company\n\nMisuse may result in immediate suspension or termination of access.")
